

const image1 = new Image();
// image1.src = "iron.png"
image1.src = "data:image/png;base64,"
// image1.src = 'data:image/jpeg;base64,'
image1.addEventListener('load', () => {
    const canvas = document.getElementById("canvas1");
    const ctx = canvas.getContext("2d");
    canvas.height = 819;
canvas.width = 1456;
 
    ctx.drawImage(image1, 0, 0, canvas.width, canvas.height);
    const scannedImage = ctx.getImageData(0, 0, canvas.width, canvas.height);
    ctx.clearRect(0,0,canvas.width,canvas.height);
    // const scannedData = scannedImage.data;
    // for(let i=0; i<scannedData.length; i+=4){
    //      const total = scannedData[i]+scannedData[i+1]+scannedData[i+2];
    //      const averageColorValue = total/3;
    //      scannedData[i] = averageColorValue;
    //      scannedData[i+1] = averageColorValue;
    //      scannedData[i+2] = averageColorValue;
    // }
    // scannedImage.data = scannedData;
    // ctx.putImageData(scannedImage,0,0);

    let particleArray = [];
    const numberOfParticle = 12000;

    let mappedImage = [];

    for (let y = 0; y < canvas.height; y++) {
        let row = [];
        for (let x = 0; x < canvas.width; x++) {
            const red = scannedImage.data[(y * 4 * scannedImage.width) + (x * 4)];
            const green = scannedImage.data[(y * 4 *scannedImage.width) + (x * 4 + 1)];
            const blue = scannedImage.data[(y * 4 *scannedImage .width) + (x * 4 + 2)];
            const alpha = scannedImage.data[(y * 4 *scannedImage .width) + (x * 4 + 3)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBrightness = brightness,
                color = `rgb(${red},${green},${blue})`
            ];
            row.push(cell);
        }
        mappedImage.push(row)

    }
    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 +
            (blue * blue) * 0.114
        ) / 100;
    }



    class Particle {
        constructor() {
            this.x = Math.random() * canvas.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 0.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.color = "white"
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage[this.position1][this.position2][0]
            let movement = (2.5 - this.speed) + this.velocity;
            this.y += movement;
            if (this.y >= canvas.height) {
                this.y = 0;
                this.x = Math.random() * canvas.width;
            }
            ctx.fillStyle = mappedImage[this.position1][this.position2][1]
        }
        draw() {
            ctx.beginPath();
           
            // ctx.fillStyle = "white";
            ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx.fill();
        }
    }

    function init() {
        for (let i = 0; i < numberOfParticle; i++) {
            particleArray.push(new Particle);
        }
    }
    init();console.log(particleArray)

    function animate() {
        // ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height)
        ctx.globalAlpha = 0.05;
        ctx.fillStyle = 'rgb(0,0,0)';
        ctx.fillRect(0, 0, canvas.width, canvas.height);
        ctx.globalAlpha = 0.02;
        for (let i = 0; i < particleArray.length; i++) {
            particleArray[i].update();
            ctx.globalAlpha = particleArray[i].speed * 0.5;
            particleArray[i].draw();
        }
        requestAnimationFrame(animate);
    }
    animate();

})